package buddyStrings

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

type para struct {
	one string
	two string
}

type ans struct {
	one bool
}

type question struct {
	p para
	a ans
}

func Test_OK(t *testing.T) {
	ast := assert.New(t)
	qs := []question{
		question{
			p: para{
				one: "",
				two: "",
			},
			a: ans{
				one: true,
			},
		},
		question{
			p: para{
				one: "aaaaaaabc",
				two: "aaaaaaacb",
			},
			a: ans{
				one: true,
			},
		},
		question{
			p: para{
				one: "ab",
				two: "ba",
			},
			a: ans{
				one: true,
			},
		},
		question{
			p: para{
				one: "aa",
				two: "aa",
			},
			a: ans{
				one: true,
			},
		},
		question{
			p: para{
				one: "ab",
				two: "ab",
			},
			a: ans{
				one: false,
			},
		},
		question{
			p: para{
				one: "abcd",
				two: "badc",
			},
			a: ans{
				one: false,
			},
		},
		question{
			p: para{
				one: "abab",
				two: "abab",
			},
			a: ans{
				one: true,
			},
		},
		question{
			p: para{
				one: "abbbbbbb",
				two: "babbbbbb",
			},
			a: ans{
				one: true,
			},
		},
	}

	for _, q := range qs {
		a, p := q.a, q.p
		ast.Equal(a.one, buddyStrings(p.one, p.two), "输入:%v", p)
	}

	// ast.Panics(func() { longestPalindrome([]int{}, []int{}) }, "对空切片求中位数，却没有panic")

}
